INSERT INTO `how_to_plays` (`id`, `how_to_play`, `created_at`, `updated_at`) VALUES
(1, '<p><b>Depositing Money</b></p><p><b></b><u></u>1.Kindly deposit money to our account only.</p><p>2. Minimum deposit amount is 1000 points , below 1000 no deposit&nbsp; will not be accepted.</p><p>3. The amount of money you deposit accordingly&nbsp;the points will be added to your corresponding account.</p><p>4. After deposit, our system will add points in next 15 minutes.<u></u></p><p><b>Point&nbsp;Distribution</b></p><p><b></b>Rs. 1 = 1 Point.<b></b></p><p><u></u><b>Game Policy</b></p><p>1. There are different games which can be played and enjoyed in the application, Minimum points to enter a game is <b>10.</b></p><p>2.\r\n\r\nEach win ensures you more points, which are added to your skstar wallet.</p><p>3. If you want to encash your points, just call or message us. You can withdraw it using this application also the amount will be transferred as soon as possible.</p><p>4. To encash your points you need to contact the admin only on the support number mentioned in the application.Any player contacting any third person or an impersonator will be solely responsible for his/her loss.</p><p><u><b></b></u><b>Contact Us</b><u><b></b></u></p><p><b></b>In case of any inconvenience experienced OR further query associated with the application then you can contact us.<b></b></p><p><br></p>', NULL, '2019-05-21 04:37:44');
