INSERT INTO `privacy_policies` (`id`, `privacy_police`, `created_at`, `updated_at`) VALUES
(1, '<p></p><h1>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; “SK star Game”</h1>\r\n\r\n<h1>Disclaimer-</h1>\r\n\r\n<p>The Sky star Game is a prediction game\r\nespecially designed wholly for entertainment purposes. This same does not\r\ninclude any “bumper draw of a lottery” as defined under The Lotteries\r\n(Regulation) Act, 1998. This game is open for the audience present nationally\r\nsubject to the rules of their states, but it does not include those audiences\r\nwho are not eligible by age or by law of their land, to use this app in any\r\nsense. This game does not include any fraud or mischievous activities.\r\nAudiences are advised to use the application on their own risk and abilities.\r\nThe information provided by the users will be at their own risk and\r\nresponsibilities. This application/game is a game of ability. We do not\r\nguarantee every gamer or person any prize on wining. Access and use of this\r\napplication is provided subject to the given terms and conditions, and you are\r\ndeemed to have read, understood, accepted and agreed to be bound by the said\r\nterms and conditions. Please read the terms and conditions carefully as access\r\nand use of this application constitute acceptance of these terms &amp;\r\nconditions.</p><p><br></p><h1><a target=\"_blank\" rel=\"nofollow\">Privacy Policy-</a></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We at SK STAR have created this Privacy Policy to describe how\r\ninformation is collected, used, and disclosed when you visit or use a SK STAR\r\napplication. By accessing and/or using this SK Star website or any SK star\r\napplication, you are accepting the practices described in this Privacy Policy</p>\r\n\r\n<p>&nbsp;You must be at least\r\neighteen (18) years of age to access or use SK Star application.  If you\r\nare younger than eighteen (18) (or the age of legal majority where you live):\r\nyou must not access or use SK Star application. If you are a parent or legal\r\nguardian of a user under the age of eighteen (18), you agree to be fully\r\nresponsible for the acts or omissions of such user in relation to any SK Star\r\napplication.</p>\r\n\r\n<h1><a target=\"_blank\" rel=\"nofollow\">INFORMATION THAT WE MAY COLLECT</a></h1>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>Personally Identifiable Information:</u></a><u></u></h2>\r\n\r\n<p>We may collect the following\r\ninformation when you sign up with a SK STAR application: first name, last name,\r\ndate of birth, email address, mailing address, phone number, credit or debit\r\ncard information or other payment details, depending on your form of payment.</p>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>Technical Information:</u></a><u></u></h2>\r\n\r\n<p>When a user accesses a SK Star\r\napplication, we may collect technical information about the user’s device, such\r\nas the IP address that requested the display of the SK Star application,\r\nwhether you are connected to Wi-Fi or to Mobile Data, name of the Internet\r\nservice provider, the operating system type, the battery status of your device,\r\nthe resolution of your device’s screen and the identifiers associated with the\r\ndevice.</p>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>Sign Up and Survey information:</u></a><u></u></h2>\r\n\r\n<p>Any information you provide to us, and\r\nany information you choose to share about yourself as part of your use of any\r\nSK Star application, may be stored as entered, such as your authentication\r\nmethod and information.</p>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>Cookies and Web beacons:</u></a><u></u></h2>\r\n\r\n<p>Cookies are text\r\nfiles that we and our service providers may place on your device\'s browser to\r\nenable our systems to recognize your browser and to provide more features. This\r\napplication use cookies, as well as third party cookies from Google Analytics.\r\nThese are used to improve your gaming experience with us and to collect your\r\nviews, comments and remarks to improve our services. We may use Adobe Flash\r\ncookies to remember your settings, preferences and usage within a SK Star\r\napplication. Web beacons, clear .gifs or similar technologies are small pieces\r\nof code that we and our service providers may place on a SK Star application to\r\nmonitor and collect data about visitor behavior within the SK Star application.</p>\r\n\r\n<p>We may receive a confirmation when you\r\nopen email from SK Star, if your computer supports such capabilities. We may\r\nalso track other types of information, such as what games users download and\r\ninstall, any download errors, what games users purchase, how long our users\r\nhave been participating in any SK Star Offerings, the last time a user accessed\r\na SK Star Offering, user behavior and game play (e.g., which options you\r\nchoose, your progress in the game, how long you play), whether a user has won\r\nany of our games, sweepstakes, contests or other promotions featured on a SK\r\nStar application ad response measurement and other SK Star application\r\nanalytics.</p>\r\n\r\n<p>We use cookies for a variety of\r\nreasons, including to: (i) analyze the usage of SK Star application; (ii)\r\nprovide a more personalized experience; (iii) manage advertising; (iv) allow\r\nyou to more easily log in to SK Star application; (v) help make your use of SK\r\nStar application more efficient and more valuable by providing you with a\r\ncustomized experience and recognizing you when you return. We may also employ\r\nweb beacons or other technology for a variety of reasons such as: (i) allowing\r\nus to know if a certain page was visited or whether an email was opened; and\r\n(ii) tracking pixels, which allow us to advertise more efficiently by excluding\r\nour current users from certain promotional messages or identifying the source\r\nof a new installation.</p>\r\n\r\n<p>You can set your web browser to warn\r\nyou about attempts to place cookies on your computer, limit the type of cookies\r\nyou allow or refuse cookies all together. However, you may not be able to use\r\nsome or all of the features of SK Star application if you refuse/disable\r\ncookies.</p>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>Social Networking Sites:</u></a><u></u></h2>\r\n\r\n<p>If you access a SK Star application\r\nvia a third party social networking site (a \"Social Game\"), SK Star\r\napplication may receive information about your social networking site profile,\r\nincluding without limitation the information you make publicly available, your\r\nsocial networking site user ID, your first, last and user names, profile and\r\ncover photos. If you invite new members into your Social Games network or send\r\nmessages through Social Games, we may collect the information associated with\r\nthose messages, including your friends\' social networking site user IDs, email\r\naddresses and content.</p>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>Mobile:</u></a><u></u></h2>\r\n\r\n<p>When you download or access SK Star\r\napplication via a mobile device, we and our service providers may receive\r\ninformation about your location (based on your IP address) and your mobile\r\ndevice, including various unique identifiers associated with your device,\r\nhardware type, the version of your operating system and your in-game activity.\r\nWe and our service providers may use this information to provide you with\r\npersonalized advertising and other content, including advertising and content\r\nbased on your location.</p>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>Aggregated, Anonymous Information:</u></a><u></u></h2>\r\n\r\n<p>We may collect\r\naggregated, anonymized information via SK Star application that does not\r\nidentify any single user or device. If you choose to provide a username within\r\na SK Star application, please do not provide as your username any information\r\nthat identifies you in real life, such as your real name.</p>\r\n\r\n<h1><a target=\"_blank\" rel=\"nofollow\">USE OF COLLECTED INFORMATION</a></h1>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>To Provide Services to You:</u></a></h2>\r\n\r\n<p>We may use your\r\nusername, email address, and password to uniquely identify you as a user of a SK\r\nStar application, to provide you with services and to process transactions. We\r\nmay use or display your username and icon or profile photo, if applicable, for\r\nthe purposes of rankings, competitions or sweepstakes, chat identification,\r\nand/or game high scores. We may use your date of birth to confirm your\r\neligibility to participate in SK Star application.</p>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>Advertising Purposes:</u></a><u></u></h2>\r\n\r\n<p>Subject to the\r\nterms of this Privacy Policy, we may use your contact information to process\r\nour promotional newsletters and/or email campaigns and to send you updates,\r\nsecurity alerts, or administrative messages relating to SK Star application.\r\nYour contact information will allow us to notify you about new features,\r\nenhancements, resolution of SK Star application problems, handle and/or route\r\nyour customer support questions and issues, and inform you of upgrade\r\nopportunities, sweepstakes, contests, prizes, and/or special events.</p>\r\n\r\n<p>We and our third\r\nparty service providers use cookies and other technologies, such as mobile\r\ndevice identifiers, to enhance your experience with SK Star application. These\r\ntechnologies enable us and our service providers to run our affiliate programs\r\nand provide you with customized content or offerings, such as personalized SK\r\nStar application advertisements on other websites and mobile applications and\r\npersonalized third party advertisements within certain SK Star application.\r\nCookies also enable you to automatically sign in when you access a SK Star\r\napplication, and offer other operational activities within a SK Star\r\napplication. We and our third party service providers may also use cookies and\r\nother technologies to manage and measure the performance of third party\r\nadvertisements within certain SK Star application and SK Star application\r\nadvertisements on third party sites and mobile applications. This helps us and\r\nour service providers provide more relevant advertising to you. We and our\r\nthird party service providers may also use web beacons to monitor user behavior\r\nand collect information about visitors viewing a web page.</p>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>Product Improvement and Security:</u></a><u></u></h2>\r\n\r\n<p>We may use\r\ninformation collected to calculate aggregate, anonymized statistics about our\r\nuser community for the purpose of enhancing our SK Star application, or for\r\nsecurity purposes.</p>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>Linking with Social Networks:</u></a><u></u></h2>\r\n\r\n<p>If you access a\r\nSocial Game, we may use your social networking site profile ID to link your\r\nsocial networking site account with your activities within the Social Game or\r\noffer personalized SK Star application’s advertisements on the social\r\nnetworking site. We may use your social networking site first, last and user\r\nnames and icon to identify you to the social networking site account you\'ve\r\nlinked to your activities within the Social Game, as well as for the purposes\r\nof rankings, competitions, sweepstakes, game high scores and/or identification\r\nto your social network.</p>\r\n\r\n<p>If you access a\r\nSocial Game and provide us with another person\'s contact information for\r\npurposes of delivering information through a Social Game, we may use this\r\ninformation to contact and, if necessary, remind that person that she or he has\r\nbeen invited to join a Social Game or received content through a Social Game.\r\nAll invitees are provided with the option not to receive further invitations\r\nfrom SK Star application.</p>\r\n\r\n<h1><a target=\"_blank\" rel=\"nofollow\">SECURITY</a></h1>\r\n\r\n<p>We at SK Star\r\napplication take reasonable measures to help protect the information we collect\r\nfrom loss, theft, misuse and unauthorized access, disclosure, alteration and\r\ndestruction. While we have employed security technologies and procedures to\r\nassist safeguarding your personal data, no system or network can be guaranteed\r\nto be 100% secure.</p>\r\n\r\n<h1><a target=\"_blank\" rel=\"nofollow\">SHARING INFORMATION</a></h1>\r\n\r\n<p>We may share\r\ncustomer information with SK Star Affiliates, other companies of the SK Star\r\nGroup to which SK Star application belongs, and as described below.</p>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>Third Party Marketplaces and Service\r\nProviders:</u></a><u></u></h2>\r\n\r\n<p>We may disclose your personal\r\ninformation as well as aggregate, anonymous information to third party business\r\npartners, marketplaces, and third parties who perform services for us, such as\r\ncredit card processing, prize fulfillment, sending postal mail, collecting and\r\nanalyzing data, providing search results and links (including paid listings and\r\nlinks), and providing advertising and marketing assistance, including serving\r\nads on our behalf on third party websites and mobile applications and serving\r\nads on behalf of third parties within certain SK Star working method. Those\r\nthird parties have access to your personal information only as necessary to\r\nperform their functions, and for no other purposes.</p>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>Business Transfers:</u></a><u></u></h2>\r\n\r\n<p>As SK Star application (and the SK\r\nStar Group) continues to grow, we might sell or buy certain subsidiaries and/or\r\nbusiness units. In such transactions, customer information is generally one of\r\nthe transferred assets. Also, in the unlikely event that SK Star or\r\nsubstantially all of its assets are acquired, customer information would in\r\nmost cases be one of the transferred assets. </p>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>Protection of SK Star and Others:</u></a><u></u></h2>\r\n\r\n<p>We may also disclose your information\r\nif there is a violation of the <i><u>Terms\r\nof Use</u></i><b><u>&nbsp;</u></b>or other\r\nagreements; if we have a good faith and belief that the law requires it; or if\r\nneeded to protect the rights, property or safety of SK Star, our customers or\r\nothers. This includes exchanging information with entities for fraud detection\r\nand protection, and credit risk reduction.</p>\r\n\r\n<h1><a target=\"_blank\" rel=\"nofollow\">ACCESSING YOUR INFORMATION AND YOUR CHOICES</a></h1>\r\n\r\n<p>SK Star enables you to access a wide\r\nrange of information about your account and your interactions with SK Star. If\r\nyou have created a game account, you may access your account information/\r\nprofile information by clicking on home icon in top left and clicking on \"My\r\nProfile\" on the top of the list. If you do not want to share any\r\ninformation about you, you can kindly uninstall the application.</p>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>Promotional email communications:</u></a><u></u></h2>\r\n\r\n<p>The e-mail and any other personal\r\ninformation will be used for the purpose of contacting you and solving any\r\nqueries and for the identification purposes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We will store your mail ID and may\r\nshare it with any third party for the said purpose. We will never send you any\r\nspam email or content which will not related to our application.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You can always\r\nstop receiving our emails and delete your information in our database by\r\nunsubscribing to our services in any of the emails that you receive from us.</p>\r\n\r\n<p><b><u>Mobile Advertising:</u></b></p>\r\n\r\n<p>Most mobile devices provide the\r\nability to opt out of the collection and use of information from the apps you\r\nuse for purposes of serving ads targeted to your interests. For more\r\ninformation, and to exercise these choices, consult the settings on your\r\ndevice.</p>\r\n\r\n<h2><a target=\"_blank\" rel=\"nofollow\"><u>Social Games:</u></a><u></u></h2>\r\n\r\n<p>With respect to Social Games, you may\r\nmanage your own social network privacy preferences through your social\r\nnetworking site account.</p>\r\n\r\n<h1><a target=\"_blank\" rel=\"nofollow\">THIRD-PARTIES</a></h1>\r\n\r\n<p>SK Star application may allow you to\r\nplay or share information through social media (such as by logging in through a\r\nsocial media account or using a \"Like\" button\") or contain links\r\nto social media services or other third parties. The use of these features and\r\nlinks are subject to the privacy policies of those companies and your settings\r\non those services. SK Star has no control over, and is not responsible for, the\r\ninformation submitted to or collected by social networks or other third\r\nparties. We encourage you to review those third party privacy policies to\r\nunderstand the way your information may be collected and handled by such third\r\nparties.</p>\r\n\r\n<h1><a target=\"_blank\" rel=\"nofollow\">PLAY POLICY</a></h1>\r\n\r\n<p>This game is not suppose to be used by\r\nany person less than 18 year of age or any person/children who is not legally\r\nfit to use this application. The use of this application by any such person is\r\nprohibited and SK Star will not be liable for any loss or damage caused to any\r\nperson, inconsistent to this clause. </p>\r\n\r\n<h1><a target=\"_blank\" rel=\"nofollow\">CHANGES TO PRIVACY POLICY</a></h1>\r\n\r\n<p>We may modify this Privacy Policy from\r\ntime to time. When we post changes to this Privacy Policy, we will provide an\r\nupdate in the application. We encourage you to periodically review this Privacy\r\nPolicy to be informed of how SK Star protects your information.</p>\r\n\r\n<h1><a target=\"_blank\" rel=\"nofollow\">ADDITIONAL QUESTIONS</a></h1>\r\n\r\n<p>If you have additional questions\r\nregarding this privacy policy or our handling of your personal information\r\nplease contact us at:</p>\r\n\r\n<p>Whatsapp no. : 9670693244</p>\r\n\r\n<h1><a target=\"_blank\" rel=\"nofollow\">Terms and conditions-</a></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>By use of this application, the audience, players and visitors\r\nwill agree to be bound by all the terms and conditions provided in the\r\n“application” (Game). “Terms and Conditions” will include all the content in\r\nPrivacy Policy, Disclaimer, Rules and guidelines for the game, any Notification\r\nand mail released by SK Star and any other rule whichever made later by “us”(SK\r\nStar). Any violation of the provided terms and conditions may lead in legal\r\nproceedings. The users are advised to read all the terms and conditions\r\ncarefully before using the application.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1><a target=\"_blank\" rel=\"nofollow\">Intellectual Property Rights-</a></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>All the rights relating to intellectual properties are reserved\r\nwith the application SK Star’s “Paisa Game”. All the “content” of the\r\napplication is protected and reserved with the owner. Here “Content” word\r\nincludes contents provided in writing i.e, Disclaimer, Privacy Policy, Terms\r\nand Conditions and this clause, Tips for the users and any image or Photograph\r\nor any other animation used in the application.</p>\r\n\r\n<p>Terms of Use</p>\r\n\r\n<p><b>AGREEMENT AND SERVICES</b></p>\r\n\r\n<p>Please read these Terms of Use carefully, including the mandatory\r\narbitration provision in the section titled “Dispute Resolution by way of Arbitration\r\nTribunal”, which requires that disputes are resolved by final and binding\r\narbitration on an individual only by the courts of Arbitration &amp;\r\nConciliation.</p>\r\n\r\n<p>By accessing or using any SK Star application, you agree to be\r\nbound by these Terms of Use and all terms incorporated by reference. If you do\r\nnot agree to these Terms of Use in their entirety, do not use any SK Star\r\napplication.</p>\r\n\r\n<p>You must be at least\r\neighteen (18) years of age to access or use SK Star application.  If you\r\nare younger than eighteen (18) (or the age of legal majority where you live): you\r\nmay not access or use SK Star application. If you are a parent or legal\r\nguardian of a user under the age of eighteen (18), you agree to be fully\r\nresponsible for the acts or omissions of such user in relation to any SK Star\r\napplication.</p>\r\n\r\n<p>SK Star and/or its Affiliates provide access to\r\nthe SK Star applications subject to the conditions set forth in these Terms of\r\nUse. For purposes of these Terms of Use, the term <strong>\"Affiliates\"</strong>&nbsp;means,\r\nwith respect to any party, any person or entity which controls, is controlled\r\nby, or is under common control with, such party, and the term <strong>\"SK\r\nStar\"</strong>&nbsp;means the web sites of SK Star, including <a target=\"_blank\" rel=\"nofollow\" href=\"http://www.skstar.in\">www.skstar.in</a>, any other sites on\r\nwhich these Terms of Use are posted, and any other SK Star application, service\r\nor product licensed, downloaded or otherwise accessed by you through third\r\nparty sites or sources, including the products and services available through\r\nany of the foregoing. The said terms and agreement is exclusively between SK\r\nStar and the user and not between the user and any affiliate of the SK Star and\r\nSK Star take full responsibility of its websites, application, terms of use,\r\nprivacy policy and any other content made by SK Star.</p>\r\n\r\n<p>The SK Star services are always evolving, so it\r\nis important that you periodically check these Terms of Use, as well as the\r\nspecific rules for any games or activities in which you choose to participate,\r\nfor updates. SK Star reserves the right to change or modify these Terms of Use\r\nat any time and in our sole discretion. If SK Star makes changes to these Terms\r\nof Use, we will provide notice of such changes, such as (by way of example\r\nonly) by providing notice through the SK Star application or providing an update\r\nin the application. If we revise these Terms of Use, such revision(s) will take\r\neffect immediately such notice. Your continued access or use of any SK Star\r\napplication constitutes your acceptance of the revised Terms of Use. We\r\nencourage you to frequently review these Terms of Use to ensure that you\r\nunderstand the terms and conditions that apply to your use of the SK Star\r\napplication. If you do not agree to any of these Terms of Use, you should\r\ndiscontinue using or participating in any and all SK Star services. If there is\r\na conflict between these Terms of Use and any other rules or instructions\r\nposted within a SK Star application, these Terms of Use will control.</p>\r\n\r\n<h2>ACCOUNT REGISTRATION</h2>\r\n\r\n<p>If you create a\r\nSK Star application account within any SK Star services, you must provide\r\ntruthful and accurate information to us in creating such account and promptly\r\nupdate this information if it changes. If SK Star has reasonable grounds to\r\nsuspect that you have provided any information that is inaccurate, not current\r\nor incomplete, SK Star may suspend or terminate your ability to use or access a\r\nSK Star services, and refuse any and all current or future use of or access to\r\nany or all SK Star services(or any portion thereof).</p>\r\n\r\n<p>SK Star reserves\r\nthe right to limit the number of accounts a user can establish. This limit may\r\nchange over time in our sole discretion.</p>\r\n\r\n<p>You are solely\r\nresponsible for all activity on any and all of your SK Star account(s) and for\r\nthe security of your computer system/mobile phone. You should not reveal your\r\nusername or password to any other person. SK Star will not ask you to reveal\r\nyour password. If you forget your password, you can request to have a new\r\npassword sent to your registered mobile no. and by receiving One Time Password\r\n(OTP) you can set a new password. You agree to indemnify and hold SK Star and\r\ntheir respective employees, contractors, officers, directors, shareholders,\r\nagents, representatives, vendors, and content providers harmless for any\r\nimproper or illegal use of any of your SK Star account(s). This includes\r\nillegal or improper use by someone to whom you have given permission to use\r\nyour SK Star account(s) or whom you have negligently allowed to access your SK\r\nStar account(s). SK Star reserves the right to terminate your SK Star account(s)\r\nif any activity that occurs with respect to such account(s) violates these\r\nTerms of Use.</p>\r\n\r\n<h2>ELECTRONIC COMMUNICATIONS</h2>\r\n\r\n<p>When you access\r\na SK Star services, send e-mails or electronically chat with SK Star, you are\r\ncommunicating with us electronically. You consent to receive communications\r\nfrom us electronically. We will communicate with you by e-mail or whatsapp or\r\nby posting notices in the SK Star application. You agree that all agreements,\r\nnotices, disclosures and other communications that SK Star provides to you\r\nelectronically satisfy any legal requirement that such communications be in\r\nwriting.</p>\r\n\r\n<h2>SOCIAL NETWORK SITES</h2>\r\n\r\n<p>If you access a\r\nSK Star application/ services via a third party social networking site (a <strong>\"Social Game\"</strong>), you should be aware that Social Games are only available\r\nto individuals who have registered with the social networking site through\r\nwhich s/he accesses Social Games. You agree that your social networking site\r\naccount information is accurate, current and complete.</p>\r\n\r\n<p>If SK Star has\r\nreasonable grounds to suspect that you have provided any information that is\r\ninaccurate, not current or incomplete, SK Star may suspend or terminate your\r\nability to use or access Social Games and refuse any and all current or future\r\nuse of or access to Social Games (or any portion thereof).</p>\r\n\r\n<p><b>VIOLATION OF THESE\r\nTERMS OF USE</b></p>\r\n\r\n<p>If you violate our Terms of Use, SK Star reserves the right, in\r\nits sole discretion, to immediately terminate your participation in any or all SK\r\nStar Services, including any and all SK Star accounts you have established. You\r\nacknowledge that SK Star is not required to notify you prior to terminating any\r\nsuch account.</p>\r\n\r\n<p><b>LEGAL ACTION AND DISPUTE RESOLUTION BY WAY OF ARBITRATION TRIBUNAL </b></p>\r\n\r\n<p>In case of any violation of Terms of Use,\r\nPrivacy Policy, any rules or any conditions made later on will be punishable\r\nand will be of serious legal liability. Person or persons violating these\r\naforesaid rules will bear legal consequences. The Deciding authority and courts\r\nwill be the Court of Arbitration and Conciliation, located near the residing\r\nplace or near the place of usual course of business of SK Star.</p>\r\n\r\n<p><b>INTELLECTUAL PROPERTY RIGHTS</b></p>\r\n\r\n<p>All the rights\r\nrelating to intellectual properties are reserved with the application “SK\r\nStar”. All the “content” of the application is protected and reserved with the\r\nowner. Here “Content” word includes contents provided in writing e.i.,\r\nDisclaimer, Privacy Policy, Terms and Conditions, Tips for the users and any\r\nimage or Photograph or any other animation used in the application.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b>CONTACT US</b></p>\r\n\r\n<p>For any queries and questions related to\r\nterms of use or any other rule or game related doubts, you can contact on:</p>\r\n\r\n\r\n\r\n\r\n\r\n<br><p></p>\r\n\r\n\r\n\r\n\r\n\r\n<br><p></p>', NULL, '2019-06-27 08:36:31');
